import './App.css';
import Checkout from './Checkout';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Container>
      <Router>
        <Switch>

          <Route path='/checkout'>
          <Header/>
          <Checkout/>
          </Route>

          <Route path='/'>
          <Header/>
          <Home/>
          </Route>

        </Switch>
      </Router>
      </Container>


    </div>
  );
}

export default App;
